DROP DATABASE IF EXISTS proyectoFinal;
CREATE DATABASE proyectoFinal;
USE proyectoFinal;

CREATE TABLE cliente(
    id_cliente VARCHAR(20) PRIMARY KEY,
    nombre VARCHAR(15),
    apellidos VARCHAR(30),
    telefono INT(9),
    email VARCHAR(50),
    contraseña VARCHAR(15),    
    tipo enum('Administrador','Cliente')
);

CREATE TABLE pedido(
    id_pedido INT(11) PRIMARY KEY AUTO_INCREMENT,
    fecha DATE,
    id_cliente VARCHAR(20),
    CONSTRAINT idCliente_fk FOREIGN KEY (id_cliente) REFERENCES cliente(id_cliente)
);

CREATE TABLE plato(
    id_plato VARCHAR(20) PRIMARY KEY ,
    nombre VARCHAR(50),
    categoria VARCHAR(50),
    precio DEC(10,2),
    imagen longblob,
    descripcion VARCHAR(500)
);

CREATE TABLE pedido_plato(
    id_plato VARCHAR(20),
    id_pedido INT(11),
    CONSTRAINT idPlato_fk FOREIGN KEY (id_plato) REFERENCES plato(id_plato),
    CONSTRAINT idPedido_fk FOREIGN KEY (id_pedido) REFERENCES pedido(id_pedido)
);

CREATE TABLE menu(
    id_menu INT(11) PRIMARY KEY AUTO_INCREMENT,
    nombre VARCHAR(50),
    imagen longblob,
    precio DEC(10,2),
    descripcion VARCHAR(500)
);

CREATE TABLE pedido_menu(
    id_pedido INT(11),
    id_menu INT(11),
    CONSTRAINT idPedido_fk2 FOREIGN KEY (id_pedido) REFERENCES pedido(id_pedido),
    CONSTRAINT idMenu_fk FOREIGN KEY (id_menu) REFERENCES menu(id_menu)
);

CREATE TABLE diario(
    id_menu INT(11) PRIMARY KEY,
    fecha DATE,
    CONSTRAINT idMenu_fk2 FOREIGN KEY (id_menu) REFERENCES menu(id_menu)
);

CREATE TABLE plato_mDiario(
    id_plato VARCHAR(20),
    id_menu INT(11),
    CONSTRAINT idMenu_fk4 FOREIGN KEY (id_menu) REFERENCES menu(id_menu),
    CONSTRAINT idPlato_fk3 FOREIGN KEY (id_plato) REFERENCES plato(id_plato)
);


CREATE TABLE semanal(
    id_menu INT(11) PRIMARY KEY,
    fechaInicio DATE,
    fechaFinal DATE,
    CONSTRAINT idMenu_fk3 FOREIGN KEY (id_menu) REFERENCES menu(id_menu)
);

CREATE TABLE plato_mSemanal(
    id_plato VARCHAR(20),
    id_menu INT(11),
    categoria VARCHAR(50),
    CONSTRAINT idMenu_fk5 FOREIGN KEY (id_menu) REFERENCES menu(id_menu),
    CONSTRAINT idPlato_fk2 FOREIGN KEY (id_plato) REFERENCES plato(id_plato)
);

CREATE TABLE solicitud(
    id_solicitud INT(11) PRIMARY KEY AUTO_INCREMENT,
    titulo VARCHAR(50),
    contenido VARCHAR(500),
    email VARCHAR(50),
    estado enum('En espera','Aceptada', 'Rechazada')
)

